// Crear gráfico principal
function createChart(data) {
    const ctx = document.getElementById('graph').getContext('2d');
    new Chart(ctx, {
        type: 'bar',
        data: data,
        options: {
            responsive: true,
            onClick: (event, chartElement) => {
                if (chartElement.length > 0) {
                    const datasetIndex = chartElement[0]._index;
                    const value = data.datasets[0].data[datasetIndex];
                    const maxInputValue = 2555674559; // Número máximo que podrías recibir, 32-bit
                    const speed = ((maxInputValue - value) / maxInputValue) * 180 - 90; // Escalar a -90 a 90 
                    let normalizedVolume = value / 2555674559;
                    normalizedVolume = Math.max(minVolume, Math.min(normalizedVolume, maxVolume));  // Limitar entre 0.1 y 1
        
                    playSound(speed, normalizedVolume);
                }
            }
        }
    });
}

